CREATE TABLE "user" (
    "id" SERIAL PRIMARY KEY,
    "username" VARCHAR (80) UNIQUE NOT NULL,
    "password" VARCHAR (1000) NOT NULL,
    "proficiency_level" DECIMAL DEFAULT 1.00,
    "favorite_trick" VARCHAR (200),
    "favorite_kendama" VARCHAR (200) 
);

CREATE TABLE "trick" (
    "id" SERIAL PRIMARY KEY,
    "name" VARCHAR (200) NOT NULL,
    "level" INT NOT NULL,
    "description" VARCHAR (800),
    "video_url" VARCHAR (2000)
);

CREATE TABLE "user_trick" (
    "id" SERIAL PRIMARY KEY,
    "user_id" INT REFERENCES "user",
    "trick_id" INT REFERENCES "trick",
    "session_countdown" INT NOT NULL DEFAULT 0,
    "mastery_level" INT NOT NULL DEFAULT 0,
    "hidden" BOOLEAN NOT NULL DEFAULT FALSE,
    "note" VARCHAR (1000)
);

